webpackJsonp([0x81b8806e4260],{337:function(A,e){A.exports={data:{allMarkdownRemark:{edges:[{node:{html:"<h1>Van’s Car Wash</h1>\n<p>Van’s Car Wash is a local car wash chain serving seven locations across the West Michigan area. Before Vans came to us he had no website. The main objective of the site was to provide the Google location for each car wash across the area, so that’s what I did. The website has all locations and Google iFrames for easy navigation. The biggest priority for the site was for it to be mobile friendly. Most of the users who would be viewing the site would be on their mobile devices.</p>\n<h2>Design</h2>\n<p>I had a lot of fun designing this site and feel that it is clean and sharp. The white background with hints of blue keep the content clean and specific to the content. The mock up was created in Photoshop and once the design was approved I moved to development.</p>\n<h2>Development</h2>\n<p>The site was developed in WordPress. No theme was used to create this site. I used a blank template and started from scratch. There was no blog or post types, so development of the site was primarily kept to HTML, CSS, and Javascript. By using Advances Custom Fields plugin, I was able to make it so the owner could easily come in and swap the coupon pictures out. The purpose of a CMS is to bring ease of use to the client and that is just what Van’s Car Wash does.</p>",frontmatter:{path:"/vans-carwash",title:"Vans Carwash",category:"wordpress",featuredText:"Van’s Car Wash is a local car wash chain serving seven locations across the West Michigan area.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.2149532710280373,src:"/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-17ae0.jpg",srcSet:"/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-3f4bd.jpg 98w,\n/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-231fe.jpg 195w,\n/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-17ae0.jpg 390w,\n/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-e78f1.jpg 585w,\n/static/VANS_Featured-7b767ca457f890ed1de1fe0dad4c6e52-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{html:"<h1>AAA Poured Walls</h1>\n<p>AAA is a concrete pouring company who specializes in custom stonework. Their services encompass poured walls, flat work, and decorative concrete. I had a lot of fun with this design and feel it is one of my better designs. The client was happy to showcase their new website, and they were even happier to be able to manage it themselves.</p>",frontmatter:{path:"/aaa",title:"AAA",category:"wordpress",featuredText:"AAA is a concrete pouring company who specializes in custom stonework.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.1992619926199262,src:"/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-17ae0.jpg",srcSet:"/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-3f4bd.jpg 98w,\n/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-231fe.jpg 195w,\n/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-17ae0.jpg 390w,\n/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-e78f1.jpg 585w,\n/static/AAA_Featured-9def1918dde01e995570d8e9f89670f8-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}},{node:{html:"<h1>Reliable Sport</h1>\n<p>Reliable Sport was a fun website for me. It was built in our open source .NET MVC e-commerce platform called NopCommerce. The site was different from other because I was tasked with imported over 200 products into the new system. Reliable sells many items including pool tables, mopeds, arcade systems and many more.</p>",frontmatter:{path:"/reliable",title:"Reliable Sport",category:"ecommerce",featuredText:"AAA is a concrete pouring company who specializes in custom stonework.",featuredImage:{childImageSharp:{sizes:{base64:"data:image/jpeg;base64,",aspectRatio:1.6129032258064515,src:"/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-17ae0.jpg",srcSet:"/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-3f4bd.jpg 98w,\n/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-231fe.jpg 195w,\n/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-17ae0.jpg 390w,\n/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-e78f1.jpg 585w,\n/static/Reliable_Featured-6c433c715fb721bfe29f345e274f1c4a-f88f9.jpg 650w",sizes:"(max-width: 390px) 100vw, 390px"}}}}}}]}},pathContext:{}}}});
